from typing import List
from collections import Counter,defaultdict
from math import *
from functools import reduce

class Solution:
    def numMatchingSubseq(self, s: str, words: List[str]) -> int:
        list_char_count = []
        char = s[0]
        count = 1
        for c in s[1:]:
            if char == c:
                count+=1
            else:
                list_char_count.append((char,count))
                char = c
                count = 1
        list_char_count.append((char,count))
        
        matching_sub_seq_count = 0
        
        for word in words:
            word_length = len(word)
            list_char_count_index = 0
            word_string_index = 0
            
            char,count = ("",0)
            while list_char_count_index<len(list_char_count) and word_string_index<word_length:
                if count == 0:                
                    char,count = list_char_count[list_char_count_index]
                    list_char_count_index += 1
                if char == word[word_string_index]:
                    word_string_index += 1
                    count -= 1
                else:
                    count = 0
            while count and word_string_index<word_length:
                if char == word[word_string_index]:
                    word_string_index += 1
                    count -= 1
                else:
                    count = 0

            if word_string_index == word_length:
                matching_sub_seq_count += 1 
        return matching_sub_seq_count

